import React from 'react'
import ReactTyped from "react-typed";

const Landing = () => {
    const headingStrings = ["an engineer.", "a sewist.", "a problem solver.", "a ball of sunshine.", "I love ducks!!!"];
    return (
        <div>
            <h1 className='heading-animation'>
                Hi! My name is Elangeni and I am {" "}
                <ReactTyped strings={headingStrings} typeSpeed={100} loop />
            </h1>
            <div className="button-container">
                <h2 className="button-prompt">Wanna see cool stuff?</h2>
                <button className="landing-button">Yes!</button>
                <button className="landing-button">No, but actually yes</button>
            </div>
        </div>
    )
}

export default Landing
